import { useState } from "react";
import "./App.css";
function App() {
  const [header, setHeader] = useState("Enter your details----");
  const ChangeHandlerInp=event=>{
    let regexPassword=/^(?=.*\d)(?=.*[A-Z])(?=.*[a-z])(?=.*[a-zA-Z!#$@^%&? "])[a-zA-Z0-9!#$@^%&?]{8,20}$/;
    let regexPhone=/^\d{10}$/;
    let regexEmail=/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
    let id=event.target.getAttribute("id");
    let value=event.target.value;
    if(id==="newEmail"){
        if(regexEmail.test(value)!==true){
        this.setState({
            paraNewEmail:"Enter a valid email"
        })}
        else{
            this.setState({
                paraNewEmail:""
            })
        }
    }
    if(id==="newPhone"){
        if(regexPhone.test(value)!==true){
        this.setState({
            paraNewPhone:"Enter a valid number"
        })}
        else{
            this.setState({
                paraNewPhone:""
            })
        }
    }
    if(id==="newPassword"){
        if(regexPassword.test(value)!==true){
        this.setState({
            paraNewPassword:"Password should contain an uppercase,a lowercase and a special character"
        })}
        else{
            this.setState({
                paraNewPassword:""
            })
        }
    }
  }
  return (
    <div className="container">
      <div id="header">{header}</div>
      <div>
        <div className="labels">Enter your Name</div>
        <div className="inputs">
          <input type="text" id="inpName"/>
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Enter your Email</div>
        <div className="inputs">
          <input type="email" id="inpEmail"/>
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Enter your Password</div>
        <div className="inputs">
          <input type="password" id="inpPassword"/>
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Enter your Address</div>
        <div className="inputs">
          <textarea />
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Enter your Mobile</div>
        <div className="inputs">
          <input type="number" />
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Select your Gender</div>
        <div className="inputs">
          <input type="radio" value="Male" />
          Male
          <input type="radio" value="Female" />
          Female
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Enter your Hobbies</div>
        <div className="inputs">
          <input type="checkbox" value="Cricket" />
          <input type="checkbox" value="Singing" />
          <input type="checkbox" value="Dancing" />
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div>
        <div className="labels">Choose your Profile Pic</div>
        <div className="inputs">
          <input type="file" />
        </div>
      </div>
      <p className="paraError">Enter</p>
      <div><div className="labels">Select your DOB</div><div className="inputs"><select></select><select></select><select></select></div></div>
      <p className="paraError">Enter</p>
      <div id="footer">
        <button id="btnRegister">Register Me</button>
        <button id="btnReset">Reset</button>
      </div>
    </div>
  );
}

export default App;
